import { update } from 'lodash';
import React, { useState } from 'react';
import { useEffect } from 'react';
import SockJsClient from 'react-stomp';

const WebSocketClient = ({ sendUpdate, onUpdate }) => {

    const [client, setClient] = useState();
    const [updateToSend, setUpdateToSend] = useState();

    useEffect(() => {
        console.log(updateToSend);
    }, [updateToSend]);

    const SOCKET_URL = 'http://localhost:8080/ws';
    const topics =['/topic/party-updates'];

    const onConnect = () => console.log("Connected with WS");
    const onDisconnect = () => console.log("Disconnected from WS");

    return(
        <SockJsClient
            url={SOCKET_URL}
            topics={topics}
            onConnect={onConnect}
            onDisconnect={onDisconnect}
            onMessage={onUpdate}
            debug={false}
            ref={setClient}
        />
    );
}

export default WebSocketClient;
